import React from "react";
import styled from "styled-components";
import palette from "../../lib/styles/palette";
import BgSection from "../common/BgSection";
import Button from "../common/Button";
import { CgLoadbarDoc } from "react-icons/cg";
import { FaGithub } from "react-icons/fa";

const Head = () => {
  return (
    <BgSection bgName="main-bg4">
      <div>
        <Title>About</Title>
      </div>
      <ButtonBox>
        <Button
          to={{
            pathname:
              "https://www.notion.so/yoonvelop/Hyebin-Yoon-c06bf6b603034b38872610b1e4b4c5c0",
          }}
          target="_blank"
        >
          <CgLoadbarDoc />
          Resume
        </Button>
        <Button
          to={{
            pathname: "https://github.com/yoonvelop",
          }}
          target="_blank"
        >
          <FaGithub />
          GitHub
        </Button>
        <Button
          to={{
            pathname: "https://velog.io/@yoonvelop",
          }}
          target="_blank"
        >
          Velog
        </Button>
      </ButtonBox>
    </BgSection>
  );
};
const Title = styled.h1`
  color: ${palette.white};
  font-size: 2.5rem;
  font-weight: 600;
  margin: 0rem 0;

  & > span {
    font-weight: 500;
    font-size: 2.2rem;
  }
`;
const ButtonBox = styled.div`
  display: flex;
`;
export default Head;
